    /// <summary>
    /// https://www.youtube.com/watch?v=s9fokUqJ76A&ab_channel=NeetCode
    /// </summary>
    /// <param name="n"></param>
    /// <returns></returns>
    public IList<string> GenerateParenthesis(int n)
    {
        var result = new List<string>();

        GenerateParenthesisInternal(n, 0, 0, new char[n * 2], 0, result);

        return result;
    }

    private void GenerateParenthesisInternal(int n, int openCount, int closedCount, char[] current, int currentIndex, List<string> result)
    {
        if (n == openCount && n == closedCount)
        {
            result.Add(new string(current));
            return;
        }

        if (openCount < n)
        {
            current[currentIndex] = '(';
            GenerateParenthesisInternal(n, openCount + 1, closedCount, current, currentIndex + 1, result);
        }

        if (closedCount < openCount)
        {
            current[currentIndex] = ')';
            GenerateParenthesisInternal(n, openCount, closedCount + 1, current, currentIndex + 1, result);
        }
    }

    /// <summary>
    /// Because the N is only between 0 - 8 we can hard code the result!!!
    /// </summary>
    /// <param name="n"></param>
    /// <returns></returns>
    public IList<string> GenerateParenthesisOrg(int n)
    {
        return n switch
        {
            1 => For1(),
            2 => For2(),
            3 => For3(),
            4 => For4(),
            5 => For5(),
            6 => For6(),
            7 => For7(),
            8 => For8()
        };
    }

